import React,{useState} from 'react'

const Todo = () => {

    const [name, setname] = useState('sdwd')
    const onchangeinput =()=>{
        setname("shubham")
    }

    return (
        <>

            <h1>{name}</h1>
            <button onClick={onchangeinput}>click me</button>
        </>
    )
}

export default Todo
